/*--------------------------Create Tables-----------------------------*/
DROP TABLE IF EXISTS doctor CASCADE;
DROP TABLE IF EXISTS  consultant CASCADE;
DROP TABLE IF EXISTS intern CASCADE;
DROP TABLE IF EXISTS resident CASCADE;
DROP TABLE IF EXISTS patient CASCADE;
DROP TABLE IF EXISTS nurse CASCADE;
DROP TABLE IF EXISTS registered CASCADE;
DROP TABLE IF EXISTS registered_midwife CASCADE;
DROP TABLE IF EXISTS enrolled CASCADE;
DROP TABLE IF EXISTS disease CASCADE;
DROP TABLE IF EXISTS family_history CASCADE;
DROP TABLE IF EXISTS procedure CASCADE;
DROP TABLE IF EXISTS test_results CASCADE;
DROP TABLE IF EXISTS diagnosis CASCADE;
DROP TABLE IF EXISTS treatment CASCADE;
DROP TABLE IF EXISTS medication CASCADE;
DROP TABLE IF EXISTS allergy CASCADE;
DROP TABLE IF EXISTS secretary CASCADE;
DROP TABLE IF EXISTS diagnosis_disease CASCADE;
DROP TABLE IF EXISTS scan CASCADE;
DROP TABLE IF EXISTS result_scan CASCADE;
DROP TABLE IF EXISTS administer_medication CASCADE;
DROP TABLE IF EXISTS treatment_diagnosis CASCADE;
DROP TABLE IF EXISTS vital_signs CASCADE;

CREATE TABLE secretary(id SERIAL PRIMARY KEY, first_name varchar(50),last_name varchar(50),password varchar(30));
CREATE TABLE doctor(id SERIAL PRIMARY KEY ,first_name varchar(50),last_name varchar(50), category varchar (30), password varchar(50),tel_number varchar(50));
CREATE TABLE consultant(id SERIAL PRIMARY KEY, doctorID int references doctor(id) ON DELETE CASCADE ON UPDATE CASCADE, specialization varchar(30));
CREATE TABLE intern(id SERIAL PRIMARY KEY, doctorID int references doctor(id) ON DELETE CASCADE ON UPDATE CASCADE);
CREATE TABLE resident(id SERIAL PRIMARY KEY, doctorID int references doctor(id) ON DELETE CASCADE ON UPDATE CASCADE);
CREATE TABLE patient(id SERIAL PRIMARY KEY, first_name varchar(50),last_name varchar(50), tel_number varchar(50), dob date, address varchar(30));
CREATE TABLE nurse(id SERIAL PRIMARY KEY, first_name varchar(50),last_name varchar(50), dob date, address varchar(30), tel_number varchar(50), category varchar(20), password varchar(50));
CREATE TABLE registered(id SERIAL PRIMARY KEY, nurseID int references nurse(id) ON DELETE CASCADE ON UPDATE CASCADE);
CREATE TABLE registered_midwife(id SERIAL PRIMARY KEY, nurseID int references nurse(id) ON DELETE CASCADE ON UPDATE CASCADE);
CREATE TABLE enrolled(id SERIAL PRIMARY KEY, nurseID int references nurse(id) ON DELETE CASCADE ON UPDATE CASCADE);
CREATE TABLE disease(id SERIAL PRIMARY KEY, disease_name varchar(40));
CREATE TABLE family_history(id SERIAL PRIMARY KEY, first_name varchar(50), last_name varchar(50), disease int references disease(id) ON DELETE CASCADE ON UPDATE CASCADE, patient int references patient(id) ON DELETE CASCADE ON UPDATE CASCADE);
CREATE TABLE procedure(id SERIAL PRIMARY KEY, test varchar(50), patient int references patient(id) ON DELETE CASCADE ON UPDATE CASCADE);
CREATE TABLE test_results(id SERIAL PRIMARY KEY, results varchar(50), procedure int references procedure(id) ON DELETE CASCADE ON UPDATE CASCADE);
CREATE TABLE diagnosis(id SERIAL PRIMARY KEY, conclusion varchar(30), diagnosis_date date, resultID int references test_results(id) ON DELETE CASCADE ON UPDATE CASCADE);
CREATE TABLE treatment(id SERIAL PRIMARY KEY, doctorID int references doctor(id), patientID int references patient(id) ON DELETE CASCADE ON UPDATE CASCADE, treatment_date date, diagnosisID int references diagnosis(id) ON DELETE CASCADE ON UPDATE CASCADE);
CREATE TABLE medication(id SERIAL PRIMARY KEY, name varchar(50));
CREATE TABLE allergy(id SERIAL PRIMARY KEY, patientID int references patient(id) ON DELETE CASCADE ON UPDATE CASCADE, medicationID int references medication(id) ON DELETE CASCADE ON UPDATE CASCADE);
CREATE TABLE diagnosis_disease(id SERIAL PRIMARY KEY, diseaseID int references disease(id) ON DELETE CASCADE ON UPDATE CASCADE, diagnosisID int references diagnosis(id) ON DELETE CASCADE ON UPDATE CASCADE);
CREATE TABLE scan(id SERIAL PRIMARY KEY, scanImg varchar(100));
CREATE TABLE result_scan(id SERIAL PRIMARY KEY, resultID int references test_results(id) ON DELETE CASCADE ON UPDATE CASCADE, scanID int references scan(id) ON DELETE CASCADE ON UPDATE CASCADE);
CREATE TABLE administer_medication(id SERIAL PRIMARY KEY, nurseID int references nurse(id) ON DELETE CASCADE ON UPDATE CASCADE , patientID int references patient(id) ON DELETE CASCADE ON UPDATE CASCADE, administer_date date);
CREATE TABLE treatment_diagnosis(id SERIAL PRIMARY KEY, treatmentID int references treatment(id), diagnosisID int references diagnosis(id) ON DELETE CASCADE ON UPDATE CASCADE );
CREATE TABLE vital_signs(id SERIAL PRIMARY KEY, sign varchar(30), patientID int references patient(id) ON DELETE CASCADE ON UPDATE CASCADE,nurseID int references nurse(id) ON DELETE CASCADE ON UPDATE CASCADE );
